data:
  definition: partie d'un ensemble qui peut être déplacée d'une position dans laquelle
    elle permet l'embrochage des contacts d'une partie amovible sur des contacts fixes
    à une position dans laquelle elle constitue une partie de l'enveloppe ou d'une
    cloison protégeant les contacts fixes
